function pi(digit) {
  var dataTemp = {};
  var piTemp = "3.";
  var vectorsize = parseInt(digit * (1000 / 3996));
  var nCells = vectorsize - 1;
  var BASE = 1e4;
  var TENTHOUSANDTH = 1e-4;
  var SQ_239E4 = 57121e4;
  var SQ_5E4 = 25e4;
  var REPAIR = 5e-6;
  var RECIPR_25 = 0.04;
  var RECIPR_239 = 1 / 57121;
  var term5 = null;
  var term239 = null;
  var sum = null;
  var series = null;
  var TwoNplus1 = 1;
  var Basex2n_1 = BASE;
  var Currdigit = 1;
  var sgn = 1;
  function MakeArray(n) {
    this.length = n;
    for (var i = 1; i <= n; i++) {
      this[i] = 0;
    }
    return this;
  }
  function PiSetup() {
    term5 = new MakeArray(vectorsize);
    term239 = new MakeArray(vectorsize);
    sum = new MakeArray(vectorsize);
    series = new MakeArray(vectorsize);
    term5[1] = 5;
    term239[1] = 239;
  }
  function DivideTerms() {
    var total5 = term5[1];
    var total239 = term239[1];
    for (var i = Currdigit; i <= nCells + 2; i++) {
      term5[i] = Math.floor(RECIPR_25 * total5 + REPAIR);
      total5 = BASE * total5 - SQ_5E4 * term5[i] + term5[i + 1];
      term239[i] = Math.floor(total239 * RECIPR_239 + REPAIR);
      total239 = BASE * total239 - SQ_239E4 * term239[i] + term239[i + 1];
    }
  }
  function SubtractTerms() {
    var carry = 0;
    var total = 0;
    for (var i = nCells + 1; i > Currdigit; i--) {
      total = 16 * term5[i] - 4 * term239[i] + carry + 6e4;
      carry = Math.floor(total * TENTHOUSANDTH + REPAIR) - 6;
      sum[i] = Math.floor(total - BASE * carry - 6e4);
    }
  }
  function DivideSum() {
    var total = sum[1];
    var reciprocal = 1 / TwoNplus1;
    for (var i = Currdigit; i <= nCells + 2; i++) {
      sum[i] = Math.floor(total * reciprocal + REPAIR);
      total = BASE * total - Basex2n_1 * sum[i] + sum[i + 1];
    }
  }
  function AddShowDigits() {
    var i = 0;
    var total = 0;
    var carry = 0;
    var strg = "x";
    var old1 = series[Currdigit + 1];
    var old2 = series[Currdigit + 2];
    for (i = nCells + 1; i >= Currdigit; i--) {
      total = series[i] + sgn * sum[i] + carry + 3e4;
      carry = Math.floor(total * TENTHOUSANDTH + REPAIR) - 3;
      series[i] = Math.floor(total - BASE * carry - 3e4);
    }
    if (old1 == series[Currdigit + 1] && old2 == series[Currdigit + 2]) {
      Currdigit++;
      strg = BASE + series[Currdigit] + " ";
      piTemp += strg.substring(1, 5);
    }
  }
  PiSetup();
  return new Promise(function(resolve, reject) {
    var time0 = new Date();
    while (Currdigit < nCells) {
      DivideTerms();
      SubtractTerms();
      DivideSum();
      linelength = AddShowDigits();
      TwoNplus1 += 2;
      Basex2n_1 = BASE * TwoNplus1;
      sgn = 0 - sgn;
    }
    var time1 = new Date();
    var elapsed = time1.getTime() - time0.getTime();
    dataTemp.digits = 4 * nCells;
    dataTemp.time = Math.floor(elapsed);
    dataTemp.pi = piTemp;
    resolve(dataTemp);
  });
}

let cloneObj = obj => {
  let newObj = {};
  if (obj instanceof Array) {
    newObj = [];
  }
  for (let key in obj) {
    let val = obj[key];
    newObj[key] = typeof val === "object" ? cloneObj(val) : val;
  }
  return newObj;
};
let GetFirstKey = data => {
  for (let key in data) {
    return key;
  }
};

